import React, { useState, useContext } from "react";
import { BrowserRouter, Routes, Route, Navigate, useNavigate, useParams } from "react-router-dom";
import { GoogleLogin, GoogleOAuthProvider } from '@react-oauth/google';
import { AuthContext, AuthProvider } from './context/AuthContext';
import './App.css';

// Placeholder components for each page
const LoginPage = () => {
  const navigate = useNavigate();

  const handleGoogleLogin = () => {
    // In a real app, this would trigger Google OAuth
    // For now, we'll just simulate a successful login and redirect
    console.log("Google login clicked");
    navigate('/');
  };

  return (
    <div className="page login-page">
      <h1>Login Page</h1>
      <div className="login-container">
        <button className="google-login-btn" onClick={handleGoogleLogin}>
          Login with Google
        </button>
      </div>
    </div>
  );
};

// Fix the HomePage component
const HomePage = () => {
  const navigate = useNavigate();
  const [searchQuery, setSearchQuery] = useState(""); // Fixed: properly name the state setter

  const handleCreateRecipe = () => {
    navigate('/create');
  };

  const handleSearch = () => {
    if (searchQuery.trim()) {
      navigate(`/search?q=${searchQuery}`);
    }
  };

  return (
    <div className="page home-page">
      <h1>Home Page / Personal Profile</h1>
      <div className="search-bar">
        <input 
          type="text" 
          placeholder="Search recipes or users..." 
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        <button onClick={handleSearch}>Search</button>
      </div>
      <div className="profile-stats">
        <div className="stat">Followers: 0</div>
        <div className="stat">Following: 0</div>
        <div className="stat">Posts: 0</div>
      </div>
      <div className="action-buttons">
        <button className="create-post-btn" onClick={handleCreateRecipe}>Create New Recipe</button>
      </div>
      <div className="posts-container">
        <h2>Your Recipes</h2>
        <p>No recipes yet. Create your first recipe!</p>
      </div>
    </div>
  );
};

const SearchResultsPage = () => (
  <div className="page search-results-page">
    <h1>Search Results</h1>
    <div className="search-bar">
      <input type="text" placeholder="Search recipes or users..." />
      <button>Search</button>
    </div>
    <div className="filters">
      <button>Recipes</button>
      <button>Users</button>
      <button>Ingredients</button>
      <button>Cooking Methods</button>
    </div>
    <div className="results-container">
      <p>No results found.</p>
    </div>
  </div>
);

const CreatePostPage = () => (
  <div className="page create-post-page">
    <h1>Create New Recipe</h1>
    <form className="recipe-form">
      <div className="form-group">
        <label>Recipe Name*</label>
        <input type="text" required />
      </div>
      <div className="form-group">
        <label>Upload Image</label>
        <input type="file" accept="image/*" />
      </div>
      <div className="form-group">
        <label>Ingredients*</label>
        <textarea placeholder="Enter ingredients with measurements" required></textarea>
      </div>
      <div className="form-group">
        <label>Cooking Time*</label>
        <input type="number" min="1" placeholder="Minutes" required />
      </div>
      <div className="form-group">
        <label>Cooking Steps*</label>
        <textarea placeholder="Describe the steps to prepare this recipe" required></textarea>
      </div>
      <div className="form-group">
        <label>Your Thoughts</label>
        <textarea placeholder="Share your thoughts about this recipe"></textarea>
      </div>
      <div className="form-actions">
        <button type="button">Save as Draft</button>
        <button type="submit">Publish</button>
      </div>
    </form>
  </div>
);

const RecipeDetailPage = () => {
  const navigate = useNavigate();
  const { id } = useParams();

  const handleChatbotClick = () => {
    navigate(`/chatbot/${id}`);
  };
  return (
    <div className="page recipe-detail-page">
      <h1>Recipe Details</h1>
      <div className="recipe-header">
        <h2>Recipe Name</h2>
        <div className="recipe-meta">
          <span>By: User</span>
          <span>Cooking Time: 0 mins</span>
        </div>
      </div>
      <div className="recipe-image">
        <div className="placeholder-image">Recipe Image</div>
      </div>
      <div className="recipe-ingredients">
        <h3>Ingredients</h3>
        <p>No ingredients listed.</p>
      </div>
      <div className="recipe-steps">
        <h3>Instructions</h3>
        <p>No instructions provided.</p>
      </div>
      <div className="recipe-actions">
        <button>Like</button>
        <button>Save</button>
        <button>Share</button>
        <button>Export as PDF</button>
        <button className="chatbot-btn">Ask Chatbot</button>
      </div>
      <div className="recipe-comments">
        <h3>Comments</h3>
        <div className="comment-form">
          <textarea placeholder="Add a comment..."></textarea>
          <button>Post</button>
        </div>
        <div className="comments-list">
          <p>No comments yet.</p>
        </div>
      </div>
    </div>
  );
};

const ChatbotPage = () => (
  <div className="page chatbot-page">
    <h1>Recipe Assistant Chatbot</h1>
    <div className="chat-container">
      <div className="chat-messages">
        <div className="message bot">
          Hello! I'm your recipe assistant. Ask me anything about this recipe!
        </div>
      </div>
      <div className="chat-input">
        <input type="text" placeholder="Type your question..." />
        <button>Send</button>
      </div>
    </div>
  </div>
);

const UserProfilePage = () => (
  <div className="page user-profile-page">
    <h1>User Profile</h1>
    <div className="profile-header">
      <div className="profile-avatar">
        <div className="placeholder-avatar">User Avatar</div>
      </div>
      <div className="profile-info">
        <h2>User Name</h2>
        <div className="profile-stats">
          <div className="stat">Followers: 0</div>
          <div className="stat">Following: 0</div>
          <div className="stat">Posts: 0</div>
        </div>
        <button className="follow-btn">Follow</button>
      </div>
    </div>
    <div className="user-recipes">
      <h3>Recipes</h3>
      <div className="recipes-grid">
        <p>No recipes published yet.</p>
      </div>
    </div>
  </div>
);

const AdminPage = () => (
  <div className="page admin-page">
    <h1>Admin Dashboard</h1>
    <div className="admin-sections">
      <div className="reports-section">
        <h2>User Reports</h2>
        <p>No pending reports.</p>
      </div>
      <div className="content-moderation">
        <h2>Content Moderation</h2>
        <p>No content waiting for review.</p>
      </div>
      <div className="user-management">
        <h2>User Management</h2>
        <div className="user-search">
          <input type="text" placeholder="Search users..." />
          <button>Search</button>
        </div>
        <p>No users found.</p>
      </div>
    </div>
  </div>
);

const LoginPageWrapper = ({ setIsLoggedIn }) => {
  const navigate = useNavigate();
  const [error, setError] = useState('');
  const { loginWithGoogle } = useContext(AuthContext);

  const handleGoogleSuccess = async (credentialResponse) => {
    try {
      // Process the Google response through your AuthContext
      await loginWithGoogle(credentialResponse.credential);
      setIsLoggedIn(true);
      navigate('/');
    } catch (err) {
      setError('Authentication failed. Please try again.');
      console.error(err);
    }
  };

  const handleGoogleError = () => {
    setError('Google Sign-In failed. Please try again.');
  };

  return (
    <div className="page login-page">
      <h1>Login Page</h1>
      {error && <p className="error-message">{error}</p>}
      <div className="login-container">
        <GoogleLogin
          onSuccess={handleGoogleSuccess}
          onError={handleGoogleError}
          useOneTap
          theme="filled_blue"
          text="signin_with"
          shape="pill"
        />
      </div>
    </div>
  );
};

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isAdmin, setIsAdmin] = useState(true);

  // Check authentication status on mount and when currentUser changes
  useEffect(() => {
    // Check if there's a token in localStorage
    const token = localStorage.getItem('auth_token');
    if (token) {
      setIsLoggedIn(true);
    } else {
      setIsLoggedIn(false);
    }
  }, []);

  return (
    <GoogleOAuthProvider clientId="202449099306-kkaij5aksnet6l64aahh5ia9o1gb25vk.apps.googleusercontent.com">
      <AuthProvider>
        <BrowserRouter>
          <div className="App">
            <Routes>
              <Route path="/login" element={<LoginPageWrapper setIsLoggedIn={setIsLoggedIn} />} />
              <Route path="/" element={isLoggedIn ? <HomePage /> : <Navigate to="/login" />} />
              {202449099306-kkaij5aksnet6l64aahh5ia9o1gb25vk.apps.googleusercontent.com}
            </Routes>
          </div>
        </BrowserRouter>
      </AuthProvider>
    </GoogleOAuthProvider>
  );
}
export default App;
